import './App.css';

function App() {
  return (
    <div class="bg-gray-100">
      <div class="flex justify-center items-center h-screen">
        <div class="bg-white p-10 rounded-lg shadow-md w-96">
          <h1 class="text-2xl font-semibold text-gray-800 border-b border-gray-300 pb-3">Weather App</h1>
          <div class="mt-6">
            <input type="text" placeholder="Enter location"
              class="w-full border border-gray-300 px-3 py-2 rounded-md focus:outline-none focus:border-blue-500" />
            <p class="mt-2 text-gray-500 text-sm">Enter your location to get the weather</p>
          </div>
          <div class="mt-4">
            <button
              class="w-full bg-blue-500 text-white px-3 py-2 rounded-md hover:bg-blue-600 shadow-md" >Detect Your
              Location</button>
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
